mapper.select:

select 

from MDT_ADMS_CODE
where ADMS_NO = #{admsNo,jdbcType=VARCHAR}
  and ADMS_CODE_GRP = #{admsCodeGrp,jdbcType=VARCHAR}
  and ADMS_CODE = #{admsCode,jdbcType=VARCHAR}
  and GRP_LEVEL = #{grpLevel,jdbcType=INTEGER}
  and ITEM_CODE_GRP = #{itemCodeGrp,jdbcType=VARCHAR}
  and ITEM_CODE = #{itemCode,jdbcType=VARCHAR}
  and UP_CODE_GRP = #{upCodeGrp,jdbcType=VARCHAR}
  and UP_CODE = #{upCode,jdbcType=VARCHAR}

mapper.delete:

delete from MDT_ADMS_CODE
where ADMS_NO = #{admsNo,jdbcType=VARCHAR}
  and ADMS_CODE_GRP = #{admsCodeGrp,jdbcType=VARCHAR}
  and ADMS_CODE = #{admsCode,jdbcType=VARCHAR}
  and GRP_LEVEL = #{grpLevel,jdbcType=INTEGER}
  and ITEM_CODE_GRP = #{itemCodeGrp,jdbcType=VARCHAR}
  and ITEM_CODE = #{itemCode,jdbcType=VARCHAR}
  and UP_CODE_GRP = #{upCodeGrp,jdbcType=VARCHAR}
  and UP_CODE = #{upCode,jdbcType=VARCHAR}

